import { Outlet, Link } from "react-router-dom";

const NavBar = () => {
  return (
    <>
      <nav>
        <ul>
          <ul>
            <Link to="/">Home</Link>
          </ul>
          <ul>
            <Link to="/login">Login</Link>
          </ul>
          <ul>
            <Link to="/mypage">MyPage</Link>
          </ul>
        </ul>
      </nav>

      <Outlet />
    </>
  );
};

export default NavBar;
